import React from "react";
import '../scss/header.scss'

class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        return (
            <div>
                <header>头部</header>
                <footer>尾部</footer>
            </div>
        )
    }
}
export default Header;
